<!DOCTYPE html>
<html>
  <head>
    <title>rawkit</title>
    <link rel="chrome-webstore-item" href="https://chrome.google.com/webstore/detail/inline-manual-authoring-t/leiejllaoknebomjeebdjfeicdaaeijp?hl=en">
    <style type="text/css">
      html, body {
        margin: 0;
        padding: 0;
        background: white;
      }
      .dot1, .dot2, .dot3, .dot4{
        width: 40px;
        height: 40px;
        background: #4285f4;
        border-radius: 20px;
        animation-name: blue;
        animation-duration: 1s;
        animation-iteration-count: infinite;
        animation-timing-function: ease-in-out;
        transform-origin: center;
      }

      .dot2{
        margin-left: 25px;
        background: #EA4335;
        animation-name: red;
      }

      .dot3{
        margin-left: 25px;
        background: #FBBC05;
        animation-name: yellow;
      }
      .dot4{
        margin-left: 25px;
        background: #34A853;
        animation-name: green;
      }

      @keyframes blue{
        0% {
          transform: translate(0px, 0px);
        }
        30% {
          transform: translate(0px, -13px);
        }
        100%{
          transform: translate(0px, 0px);
      }
      }

      @keyframes red{
        0% {
          transform: translate(0px, 0px);
        }

        40% {
          transform: translate(0px, -13px);
        }

        100%{
          transform: translate(0px, 0px);
      }
      }

      @keyframes yellow{
        0% {
          transform: translate(0px, 0px);
        }

        50% {
          transform: translate(0px, -13px);
        }

        100%{
          transform: translate(0px, 0px);
      }
      }

      @keyframes green{
        0% {
          transform: translate(0px, 0px);
        }

        60% {
          transform: translate(0px, -13px);
        }

        100%{
          transform: translate(0px, 0px);
      }
      }
      body {
        height: 100vh;
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
      }
      .loader {
        width: 100%;
        display: flex;
        align-items: center;
        justify-content: center;
      }
      button {
        margin-top: 10%;
        padding: 20px;
        border: none;
        font-size: 18px;
        border-radius: 5px;
        color: white;
        opacity: 0;
        background: #4285f4;
        text-align: center;
        transition: background 0.3s, padding 0.3s, opacity 1s;
      }
      button:hover {
        cursor: pointer;
        background: #3773D5;
        padding: 25px;
      }
      button.visible {
        opacity: 1;
      }
      .image {
        border-radius: 50%;
        overflow: hidden;
        display: block;
        width: 200px;
        height: 200px;
        margin-bottom: 10%;
        position: relative;
      }
      img {
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: auto;
      }
    </style>
  </head>
